import{_ as e,c as r,o as i,d as l}from"./app.d3d02b18.js";const f=JSON.parse('{"title":"202302","description":"","frontmatter":{},"headers":[{"level":2,"title":"0201","slug":"_0201","link":"#_0201","children":[]},{"level":2,"title":"0202","slug":"_0202","link":"#_0202","children":[]},{"level":2,"title":"0203","slug":"_0203","link":"#_0203","children":[]},{"level":2,"title":"0204-05","slug":"_0204-05","link":"#_0204-05","children":[]},{"level":2,"title":"0206","slug":"_0206","link":"#_0206","children":[]},{"level":2,"title":"0207","slug":"_0207","link":"#_0207","children":[]}],"relativePath":"work/202302.md"}'),a={name:"work/202302.md"},t=l('<h1 id="_202302" tabindex="-1">202302 <a class="header-anchor" href="#_202302" aria-hidden="true">#</a></h1><p>期望；过完农历春节，</p><ul><li>能把面试需要的算法和 react 框架源码/vite 源码有一点基础了解即可</li><li>网络相关的背书容易忘记，阔以带着看</li><li>两个月已过啥也没干，就是一条大大的咸鱼，我必须重塑自己的技能包和价值体系,想到自己目前的处境，实在是难堪</li></ul><h2 id="_0201" tabindex="-1">0201 <a class="header-anchor" href="#_0201" aria-hidden="true">#</a></h2><ul><li>npx 跟 npm 区别<a href="./.html"></a></li><li>骨架屏实践</li><li>如何做出年度报告类似支付宝/掘金/xm 这种</li><li>react 的组件懒加载</li><li>js 知识点：<a href="https://mp.weixin.qq.com/s/M8nVZPOBfivdzc1DQEqA5A" target="_blank" rel="noreferrer">面试官：你确定多窗口之间 sessionStorage 不能共享状态吗？？？</a></li></ul><h2 id="_0202" tabindex="-1">0202 <a class="header-anchor" href="#_0202" aria-hidden="true">#</a></h2><ul><li><a href="https://bythewayer.com/learn/interview/js/16js-defer-async" target="_blank" rel="noreferrer">Preload/Prefetch 两者区别</a></li><li>web 页面加载就那几个顺序，来来回回复习，有啥好记的，理解最重要</li><li>vite 相关的开始搞起来，不喜欢拖</li><li>博客引入 <a href="https://www.algolia.com/apps/AAUJSY11TX/dashboard" target="_blank" rel="noreferrer">Algolia DocSearch</a>实现全文搜索,不知道如何下手，全是英文，看不懂</li></ul><h2 id="_0203" tabindex="-1">0203 <a class="header-anchor" href="#_0203" aria-hidden="true">#</a></h2><ul><li><a href="https://mp.weixin.qq.com/s/J-13uueQVe-OBinXr669EQ" target="_blank" rel="noreferrer">JIT(即时编译)和 AOT</a> 编译可以选择放在两个时机执行：</li></ul><p>代码构建时，被称为 AOT（Ahead Of Time，提前编译或预编译），宿主环境获得的是<strong>编译后的代码</strong> 代码在宿主环境执行时，被称为 JIT（Just In Time，即时编译），代码在<strong>宿主环境编译并执行</strong></p><p>JIT 与 AOT 的区别还包括：</p><p>1.使用 JIT 的应用在首次加载时慢于 AOT，因为其需要先编译代码，而使用 AOT 的应用已经在构建时完成编译，可以直接执行代码</p><p>2.使用 JIT 的应用代码体积普遍大于使用 AOT 的应用，因为在运行时会多出编译器代码</p><ul><li>要命了，结婚要花这么多钱，完蛋，三金，项链/耳环/戒指<a href="https://zhuanlan.zhihu.com/p/428222339" target="_blank" rel="noreferrer">普通人办一场婚礼要用多少钱？</a> 三金：15000(黄金价格在高位上) 戒指：5000 婚纱照：6000 彩礼：88888 婚庆：8000 酒席和烟酒：父母出</li></ul><h2 id="_0204-05" tabindex="-1">0204-05 <a class="header-anchor" href="#_0204-05" aria-hidden="true">#</a></h2><ul><li>今日元宵，要给叔叔阿姨发节日祝福</li><li>如果不考研的话需要一起奋斗，这样生活才有意义和价值，自己一个人单枪匹马久了，也会心累。</li><li>如果考研的话还是全力支持你，不用操心任何经济上的问题</li><li>解决了生活中的一个小问题，早上睡眠慢慢恢复正常,沟通还是比较重要的</li></ul><h2 id="_0206" tabindex="-1">0206 <a class="header-anchor" href="#_0206" aria-hidden="true">#</a></h2><ul><li><a href="https://juejin.cn/post/7194435148329254972?share_token=ff8630cd-b008-438d-8d24-f817a31fcdd9" target="_blank" rel="noreferrer">TS 5.0 版发布新版 ES 装饰器、泛型参数的常量修饰、枚举增强等</a></li><li>ROI return on investment 书面解释是投资回报率，通俗来讲就是你投入 100 块钱能收回多少钱，收回 150，ROI 就是 150/100=1.5，这就是 ROI，ROI 也可以简称为投产</li><li>LTV(life time value) 生命周期总价值，意为客户终生价值，是公司从用户所有的互动中所得到的全部经济收益的总和。通常被应用于市场营销领域，用于衡量企业客户对企业所产生的价值，被定为企业是否能够取得高利润的重要参考指标</li><li>CPM 按展示付费的广告，例如朋友圈、信息流，这些广告的 CPM 价格不低，在 100 至 150 元左右，即广告曝光 1000 次收费 100 到 150 元不等。</li></ul><h2 id="_0207" tabindex="-1">0207 <a class="header-anchor" href="#_0207" aria-hidden="true">#</a></h2><ul><li><p>TDD 和 DDD</p><p>TDD: Test drive development 测试驱动开发吗，涉及场景：修复 bug/写纯函数/UI 设计</p><p>DDD: domain driven design 领域驱动设计 参考<a href="https://juejin.cn/post/7187584683478089787" target="_blank" rel="noreferrer">React 语境下前端 DDD 的长年探索经验</a></p></li><li><p>border-box 跟 content-box</p><p>标准盒子模型 W3C：浏览器默认为标准盒模型,box-sizing: content-box，即盒子的宽高=content 宽高+padding+border</p><p>怪异盒子模型，一般根据实际项目需要自行设置。即：box-sizing:border-box,会把 padding 和 border 算在 content 里</p></li><li><p>微信小程序如果新发版，用户没有刷新用到的还是老版的代码，如何通知用户发新版了？ <a href="https://developers.weixin.qq.com/miniprogram/dev/framework/runtime/update-mechanism.html" target="_blank" rel="noreferrer">更新机制</a> | <a href="https://developers.weixin.qq.com/miniprogram/dev/framework/runtime/operating-mechanism.html" target="_blank" rel="noreferrer">小程序运行机制</a></p></li></ul>',20),n=[t];function h(o,d,s,c,_,p){return i(),r("div",null,n)}const m=e(a,[["render",h]]);export{f as __pageData,m as default};
